// contracts/BBU.sol
// SPDX-License-Identifier: Apache-2.0
pragma solidity >=0.8.2;

import "../dependencies/bundle.sol";
import "./IBBU.sol";

pragma experimental ABIEncoderV2;

contract BBU is IBBU{

    using BBUSafeMath for uint256;

    // Define game constants
    uint8 private constant BEAR = 1;
    uint8 private constant BULL = 2;
    uint8 private constant UNICORN = 3;
    uint8 private constant MIN_MOVE = 1;
    uint8 private constant MAX_MOVE = 3;
    uint8 private constant GAME_STARTED_WAITING_PLAYERS_INTENTIONS = 1;
    uint8 private constant GAME_STARTED_WAITING_PLAYERS_MOVES = 2;
    uint8 private constant GAME_COMPLETED = 3;
    bytes32 private constant EMPTY_INTENTION = bytes32(0);
    bytes32 private constant EMPTY_SEED = bytes32(0);
    uint256 private constant EMPTY_MOVE = uint256(0);

    uint256 private constant NATIVE_FEES = 5;
    uint256 private constant TOKEN_FEES = 3;

    mapping(address => Player) private _players;
    mapping(string => Game) private _games;

    BBUERC20 private _token;

    mapping (uint256 => mapping(uint256 => uint8)) internal rulesMatrix; // array to store rules of game

    address payable public _gameAdmin;
    bool locked = false;

    constructor(BBUERC20 token, address payable gameAdmin) {
      _token = token;
      _gameAdmin = gameAdmin;
      rulesMatrix[BEAR][BEAR] = 0;
      rulesMatrix[BEAR][BULL] = 2;
      rulesMatrix[BEAR][UNICORN] = 1;
      rulesMatrix[BULL][BEAR] = 1;
      rulesMatrix[BULL][BULL] = 0;
      rulesMatrix[BULL][UNICORN] = 2;
      rulesMatrix[UNICORN][BEAR] = 2;
      rulesMatrix[UNICORN][BULL] = 1;
      rulesMatrix[UNICORN][UNICORN] = 0;
    }

    function register(string memory pseudo) public override onlyNonRegisteredPlayer{
      uint8[3] memory cardsLevel = [1, 1, 1];
      _players[msg.sender] = Player(true, pseudo, 0, 0, 0, 0, 1, cardsLevel, 0, 0);
      emit PlayerRegistered(msg.sender, pseudo);
    }

    function unregister() public override onlyRegisteredPlayer{
        delete _players[msg.sender];
    }

    function createGame(string memory gameId, uint256 bet) public override onlyRegisteredPlayer payable {
        require(!locked, "Reentrant call detected!");
        require(!_games[gameId].initialized, "game already registered");
        locked = true;
        bool nativeCurrency = betNativeOrToken(bet);
        uint256 actualBet = bet;
        if(nativeCurrency){
          actualBet = msg.value;
        }
        address[2] memory gamePlayers = [msg.sender, address(0)];
        bytes32[2] memory playersMoveIntention = [EMPTY_INTENTION, EMPTY_INTENTION];
        uint256[2] memory playersMove = [EMPTY_MOVE, EMPTY_MOVE];
        bytes32[2] memory playersMoveSeed = [EMPTY_SEED, EMPTY_SEED];
        _games[gameId] = Game(true, actualBet, gamePlayers, playersMoveIntention, playersMove, playersMoveSeed, GAME_STARTED_WAITING_PLAYERS_INTENTIONS, 0, nativeCurrency);
        emit GameCreated(msg.sender, gameId, actualBet, nativeCurrency);
        locked = false;
    }

    function joinGame(string memory gameId) public override payable onlyIfGameExists(gameId) onlyRegisteredPlayer returns(bool){
        require(!locked, "Reentrant call detected!");
        locked = true;
        Game storage game = _games[gameId];
        require(game.players[1] == address(0), "party is full");
        require(game.players[0] != msg.sender, "players must be different accounts");
        if(game.nativeCurrency){
          require(msg.value >= game.bet, "insufficient bet amount");
        }
        betNativeOrToken(game.bet);
        game.players[1] = msg.sender;
        emit GameStarted(gameId, game.players[0], game.players[1]);
        locked = false;
        return true;
    }

    function submitIntention(string memory  gameId, uint8 playerId, bytes32 moveIntention) public override onlyIfGameExists(gameId) onlyRegisteredPlayer returns(bool){
        Game storage game = _games[gameId];
        require(game.gameStatus == GAME_STARTED_WAITING_PLAYERS_INTENTIONS, "invalid game status");
        require(playerId == 1 || playerId == 2, "invalid player id");
        require(game.players[playerId-1] == msg.sender, "invalid player id");
        require(game.playersMoveIntention[playerId-1] == bytes32(0), "player intention already submitted");
        game.playersMoveIntention[playerId-1] = moveIntention;
        if(game.playersMoveIntention[0] != bytes32(0) && game.playersMoveIntention[1] != bytes32(0)){
            game.gameStatus = GAME_STARTED_WAITING_PLAYERS_MOVES;
        }
        return true;
    }

    function submitMove(string memory  gameId, uint8 playerId, uint256 move, uint256 seed) public override onlyIfGameExists(gameId) onlyRegisteredPlayer returns(uint8){
        Game storage game = _games[gameId];

        require(game.gameStatus == GAME_STARTED_WAITING_PLAYERS_MOVES, "invalid game status");
        require(playerId == 1 || playerId == 2, "invalid player id");
        require(game.players[playerId-1] == msg.sender, "invalid player id");
        require(game.playersMove[playerId-1] == uint8(0), "player move already submitted");
        require(move >= MIN_MOVE && move <= MAX_MOVE, "invalid move");
        bytes32 moveHash = calculateHash(move, seed);
        require(moveHash==game.playersMoveIntention[playerId-1], "submitted move is different than previously committed move");
        game.playersMove[playerId-1] = move;
        game.playersMoveSeed[playerId-1] = bytes32(seed);

        if(game.playersMove[0] != uint8(0) && game.playersMove[1] != uint8(0)){
            game.winner = rulesMatrix[game.playersMove[0]][game.playersMove[1]];
            game.gameStatus = GAME_COMPLETED;
            updatePlayersStats(game);
            emit GameFinished(gameId, game.winner);
            return game.winner;
        }

        return 0;
    }

    function updatePlayersStats(Game memory game) internal{
      Player storage player1 = _players[game.players[0]];
      Player storage player2 = _players[game.players[1]];
      player1.gamesPlayed = player1.gamesPlayed.add(1);
      player2.gamesPlayed = player2.gamesPlayed.add(1);
      uint256 winnerReward = computeWinnerReward(game.bet, game.nativeCurrency);
      if(game.winner == 1){
        player1.level = player1.level.add(1);
        player1.gamesWon = player1.gamesWon.add(1);
        updateCardsLevel(game, player1, 1);
        player2.gamesLost = player2.gamesLost.add(1);
        increasePlayerPendingRewards(player1, game.nativeCurrency, winnerReward);
      }else if(game.winner == 2){
        player2.level = player2.level.add(1);
        updateCardsLevel(game, player2, 2);
        player1.gamesLost = player1.gamesLost.add(1);
        increasePlayerPendingRewards(player2, game.nativeCurrency, winnerReward);
      }else{
        player1.gamesDraw = player1.gamesDraw.add(1);
        player2.gamesDraw = player2.gamesDraw.add(1);
      }
    }

    function increasePlayerPendingRewards(Player storage player, bool nativeCurrency, uint256 reward) internal {
      if(nativeCurrency){
        player.pendingNativeRewards = player.pendingNativeRewards.add(reward);
      }else{
        player.pendingTokenRewards = player.pendingTokenRewards.add(reward);
      }
    }

    function updateCardsLevel(Game memory game, Player storage player, uint8 winner) internal{
      uint8 move = uint8(game.playersMove[winner - 1]);
      uint8 cardLevel = player.cardsLevel[move - 1];
      player.cardsLevel[move - 1] = cardLevel + 1;
    }

    function claimNativeRewards(uint256 amount) public override onlyRegisteredPlayer{
        Player storage player = _players[msg.sender];
        require(player.pendingNativeRewards >= amount, "withdraw amount exceeds pending rewards");
        player.pendingNativeRewards = player.pendingNativeRewards.sub(amount);
        address addr = address(msg.sender);
        address payable wallet = payable(addr);
        bool success = wallet.send(amount);
        require(success, "Claim Transfer failed.");
    }

    function claimTokenRewards(uint256 amount) public override onlyRegisteredPlayer{
        Player storage player = _players[msg.sender];
        require(player.pendingTokenRewards >= amount, "withdraw amount exceeds pending rewards");
        player.pendingTokenRewards = player.pendingTokenRewards.sub(amount);
        safeTransferFrom(address(this), msg.sender, amount);
    }


    function isNativeCurrency(uint256 amount) internal view returns(bool){
        return amount == 0 || msg.value > 0;
    }

    function betNativeOrToken(uint256 amount) internal returns(bool){
        bool nativeCurrency = isNativeCurrency(amount);
        uint256 gameFees = computeFees(amount, nativeCurrency);
        uint256 bet = amount.sub(gameFees);
        if(nativeCurrency){
            bool adminTransferSuccess = _gameAdmin.send(gameFees);
            require(adminTransferSuccess, "Game Admin Transfer failed.");
            address addr = address(this);
            address payable wallet = payable(addr);
            bool betTransferSuccess = wallet.send(bet);
            require(betTransferSuccess, "Game Bet Transfer failed.");
            return true;
        }else{
            safeTransferFrom(msg.sender, _gameAdmin, gameFees);
            safeTransferFrom(msg.sender, address(this), bet);
            return false;
        }
    }

    function computeWinnerReward(uint256 amount, bool nativeCurrency) internal pure returns(uint256){
      uint256 gameFees = computeFees(amount, nativeCurrency);
      return amount.sub(gameFees).mul(2);
    }

    function computeFees(uint256 amount, bool nativeCurrency) internal pure returns(uint256){
      if(nativeCurrency){
          return amount.mul(NATIVE_FEES).div(100);
      }else{
          return amount.mul(TOKEN_FEES).div(100);
      }

    }

    function tokenAddress() public view returns(address){
        return address(_token);
    }

    function gameInfo(string memory  gameId) public view returns(Game memory){
        return _games[gameId];
    }

    function myInfo() public view returns(Player memory){
        return playerInfo(msg.sender);
    }

    function playerInfo(address playerAddress) public view returns(Player memory){
        return _players[playerAddress];
    }

    modifier onlyIfGameExists(string memory  gameId){
        require(_games[gameId].initialized, "invalid game id");
        _;
    }

    modifier onlyRegisteredPlayer(){
        require(_players[msg.sender].initialized, "player must be registered");
        _;
    }

    modifier onlyNonRegisteredPlayer(){
        require(!_players[msg.sender].initialized, "player already registered");
        _;
    }

    /**
    * @dev calculates hash to be stored as commitment.
    * @param _choiceCode BEAR(1), BULL(2) or UNICORN (3).
    * @param _randomNumber random number used to create a unique hash
    */
    function calculateHash (uint256 _choiceCode, uint256 _randomNumber) public pure returns (bytes32){
        return keccak256(abi.encodePacked(keccak256(abi.encodePacked(_choiceCode)) ^ keccak256(abi.encodePacked(_randomNumber))));
    }

    function safeTransferFrom(address from, address to, uint256 value) internal {
        _callOptionalReturn(abi.encodeWithSelector(_token.transferFrom.selector, from, to, value));
    }

    function _callOptionalReturn(bytes memory data) private {
        (bool success, bytes memory returndata) = address(_token).call(data);
        require(success, "Token call failed");
        if (returndata.length > 0) { // Return data is optional
            require(abi.decode(returndata, (bool)), "SafeERC20: ERC20 operation did not succeed");
        }
    }

    receive() external payable{

    }

    fallback() external payable{

    }
}

